import './App.css';

function App() {
  return (
    <>
      <div class="box box1">
        <div class="oddboxinner"> bangers?</div>
      </div>
      <div class="box box2">
        <div class="evenboxinner"> bangers!</div>
      </div>
      <div class="box box3">
        <div class="oddboxinner"></div>
      </div>
    </>
  );
}

export default App;
